require "test/unit/assertions"
include Test::Unit::Assertions

# @param {Integer[]} numbers
# @param {Integer} target
# @return {Integer[]}
def two_sum(numbers, target)
  l = 0
  r = numbers.size - 1
  loop do
    sum = numbers[l] + numbers[r]
    return [l+1, r+1] if sum == target
    if sum > target
      r -= 1
    else
      l += 1
    end
  end
end

numbers = [5, 25, 75]
target = 100
expected = [2, 3]
assert_equal(expected, two_sum(numbers, target))

# Example 1:
numbers = [2, 7, 11, 15]
target = 9
expected = [1, 2]
# Explanation: The sum of 2 and 7 is 9. Therefore index1 = 1, index2 = 2.
assert_equal(expected, two_sum(numbers, target))

# Example 2:
numbers = [2, 3, 4]
target = 6
expected = [1, 3]
assert_equal(expected, two_sum(numbers, target))

# Example 3:
numbers = [-1, 0]
target = -1
expected = [1, 2]
assert_equal(expected, two_sum(numbers, target))

